import React from "react";
import Plot from "react-plotly.js";


class Graph extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [
        {
          x: [1, 2, 3, 4],
          y: [0, 2, 3, 5],
          fill: 'tozeroy',
          type: 'scatter',
          name: 'Vendor',
          marker: { color: "white"}
        },
        {
          x: [1, 2, 3, 4],
          y: [3, 5, 1, 7],
          fill: 'tonexty',
          type: 'scatter',
          name: 'Provider',
          marker: { color: "white"}
        }],
      layout: {
        height: 600,
        width: 800,
        title: "Area chart",
        paper_bgcolor: '#004280',
        plot_bgcolor: '#004280',
        font: {family: "Arial",size: 18, color:"white"},
        xaxis: {range: [0, 10], zerolinecolor: "white"},
        yaxis: {range: [0, 10], zerolinecolor: "white"}
      }
    };
  }
  render() {
    return (
      <div style={{ width: "100%", height: "100%" }}>
        <Plot
          data={this.state.data}
          layout={this.state.layout}
          onInitialized={(figure) => this.setState(figure)}
          onUpdate={(figure) => this.setState(figure)}
        />
      </div>
    );
  }
}
export default Graph;
